import React from 'react';

const HomePageView = props => {
  return (
    <div>
      <button onClick={() => { this.props.history.push('/campuses')} }>All Campuses</button>
      <button onClick={() => { this.props.history.push('/students')} }>All Students </button>
    </div>
  );
};

export default HomePageView;
